import { LOGIN_REQUEST } from '../actions/auth/auth.types'

const initialState = {
  name: 'Riz',
}

export const authReducer = (state = initialState, action) => {
  console.log(action)
  switch (action.type) {
    case LOGIN_REQUEST:
      state = {
        ...state,
        ...action.payload,
      }

    default:
      return state
  }
}
